import WbnPlayer from './WbnPlayer';
import { BrowserRouter, Router, Switch } from 'react-router-dom';
const App = () => (
  <BrowserRouter>
    <Switch>
      <Route exact path='/' component={WbnPlater} />

      <Route exact path='/:activeVideo' component={WbnPlayer} />
    </Switch>
  </BrowserRouter>
);
export default App;
